$('#button').click(function() {

    var email = $('#email').val();
    var phone = $('#phone').val();
    var pattern = /^[^ ]+@[^ ]+\.[a-z]{2,3}$/;
    var phoneno = /^\d{11}$/;

    if ((email.match(pattern)) && (phone.match(phoneno)))
    {
    
     var doc = new jsPDF('l', 'mm', [529.16666667, 321.20416667]);
     var imgData = 'data:image/jpeg;base64,';
     
     doc.addImage(imgData, 'JPEG',0,0,529.16666667, 321.20416667);
     
    var name = $('#name').val();
    var email = $('#email').val();
    var phone = $('#phone').val();

    doc.setFont('helvetica', 'bold');

    doc.setFontSize(45);
    doc.setTextColor(255, 255, 255);

    var upname = name.toUpperCase();
    
    doc.text(upname, 264.583333, 173.0875, 'center');

    
    doc.save('Participation_Certificate.pdf');

    $.ajax({
            type : "POST",
            url  : "certificate.php",
            data : { name : name, email : email, phone : phone },
            success: function(res){  
                    }
        });

  }

  else{

    alert("Please provide valid details.");
    return false;

  }

}

  );